import logo from './logo.svg';
import './App.css';
import titleimg from './Title.png'
import { Container, InputAdornment, TextField } from "@mui/material";
import { useState } from "react";
import SearchIcon from "@mui/icons-material/Search";
import Button from '@mui/material/Button';



function App() {
  const [searchTerm, setSearchTerm] = useState("");

  const handleChange = (event) => {
    setSearchTerm(event.target.value);
  };
  return (
    <div className="App">
      <img src={titleimg} style={{ marginTop: 370 }} />
      <Container maxWidth="md" sx={{ mt: 20 }}>
        <TextField
          id="search"
          type="search"
          InputLabelProps={{ style: { color: '#CB8A7C' } }}
          label="Please Enter Keywords for Image Search"
          value={searchTerm}
          onChange={handleChange}
          sx={{ width: 600, borderColor: '#CB8A7C' }}
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <SearchIcon />
              </InputAdornment>
            )
          }}
        />
        <Button sx={{
          background: '#CB8A7C', ':hover': {
            bgcolor: '#CB8A7C',
            color: 'white',
          },
        }} variant="contained" size="large" style={{ marginLeft: 20, marginTop: 5 }}>Search</Button>
      </Container>
    </div>

  );
}

export default App;
